  const [selectedCountry, setSelected] = useStatete("World");
  const [url, setUrl] = useState("https://covid19.mathdro.id/api");

  return (
    <div>
      <Header />
      <CountrySelector />
      <Stats url={url} />
    </div>
  );
};

export default Index;
